import React from 'react'
import './Post.css'
import Avatar from '@material-ui/core/Avatar'
function Post() {
    return (
        <div className="post">
            <h3>Username</h3>
            <img className="post_image"src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTbAmafdPNr9fd0KC0Z98WYEC7Wl1wYlPVf-A&usqp=CAU"></img>
            <h4 className="post_text"><strong>Goal</strong>Live your life in an extraordinary way</h4>
        </div>
    )
}

export default Post
